jQuery(document).ready(function(){let $mo=jQuery;let formDetails=moformidable.forms;let otpType=moformidable.otpType;if($mo(".frm_forms input[name='form_id']").length<=0){return}$mo("div.frm_forms").each(function(){let form=$mo(this);let formID=form.find("form input[name='form_id']").val();if(formID in formDetails){let fieldID=formDetails[formID][moformidable.formkey];let img='<img alt="Loading..." src="'+moformidable.imgURL+'"/>';let messageBox='<div  class="frm_top_container frm_full" hidden id="mo_message'+fieldID+'" style="width:100%; background-color: #f7f6f7;padding: 1em 2em 1em 3.5em; text-align: center;margin-top:3px;"></div>';let button='<div class="frm_submit" ><input type= "button" id="mobutton'+fieldID+'" class="frm_button_submit"  value= "'+moformidable.buttontext+'">'+messageBox+"</div>";$mo(button).insertAfter("#"+fieldID);$mo("#mobutton"+fieldID).click(function(){var a=$mo("#"+fieldID+" input").val();$mo("#mo_message"+fieldID+"").empty(),$mo("#mo_message"+fieldID).append(img),$mo("#mo_message"+fieldID).show();$mo.ajax({url:moformidable.siteURL,type:"POST",data:{user_email:a,user_phone:a,action:moformidable.generateURL,security:moformidable.nonce},crossDomain:!0,dataType:"json",success:function(b){if(b.result==="success"){$mo("#mo_message"+fieldID).empty(),$mo("#mo_message"+fieldID).append(b.message),$mo("#mo_message"+fieldID).css("border-top","3px solid green")}else{$mo("#mo_message"+fieldID).empty(),$mo("#mo_message"+fieldID).append(b.message),$mo("#mo_message"+fieldID).css("border-top","3px solid red")}},error:function(b){}})})}})});